import React from 'react';
import Typed from 'typed.js';
import kImage from '/Users/mohitkulkarni/Desktop/coding/personal portfoilio/portfolio/src/images/k.jpg';

const Main = () => {
const typedElement = useRef(null);
useEffect(() => {
    // Initialize Typed.js on the ref element
    const typed = new Typed(typedElement.current, {
      strings: ['<i>First</i> sentence.', '&amp; a second sentence.'],
      typeSpeed: 50,
    });

    // Cleanup to destroy Typed instance when component unmounts
    return () => {
      typed.destroy();
    };
  }, []);
  return (
    <main>
      <section className="firstSection">
        <div className="leftSection">
          I'm <span class="purple">Mohit</span>,
          <div>Web Developer</div>
          <span ref={typedElement} /> 
        </div>
        <div className="rightSection">
          <img src={kImage} alt="" />
        </div>
      </section>
    </main>
  );
}

export default Main;
